--
-- Name: update_empenhos(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION update_empenhos() RETURNS trigger
    LANGUAGE plpgsql
    AS $$BEGIN
 UPDATE empenhos SET ts_empenho=now() WHERE id_empenho=new.id_empenho;

 UPDATE empenhos SET cd_situacao_empenho = 'EU' FROM empenhos_recebimentos AS b WHERE empenhos.id_empenho=b.id_empenho AND ch_visualizar = 'S' AND (dt_pagamento + 61 ) < CURRENT_DATE AND dt_aprovacao IS NULL 
 --AND (dt_pagamento + 61 ) < dt_recebimento 
 AND empenhos.id_empenho=new.id_empenho;

 UPDATE empenhos SET cd_situacao_empenho = 'EA' WHERE ch_visualizar = 'S' AND (dt_pagamento + 61 ) < CURRENT_DATE AND dt_aprovacao IS NULL 
	AND (id_empenho NOT IN (SELECT DISTINCT id_empenho FROM empenhos_recebimentos WHERE empenhos.id_empenho=id_empenho 
	--AND (empenhos.dt_pagamento + 61 ) < dt_recebimento
	) 
	OR id_empenho IN (SELECT DISTINCT empenhos_devolucoes.id_empenho 
	FROM empenhos_recebimentos, empenhos_devolucoes WHERE empenhos.id_empenho = empenhos_recebimentos.id_empenho 
	AND empenhos_devolucoes.id_empenho = empenhos_recebimentos.id_empenho 
	AND (SELECT MAX(ts_devolucao) FROM empenhos_devolucoes AS a WHERE empenhos_devolucoes.id_empenho = a.id_empenho) > 
	(SELECT MAX(ts_recebimento) FROM empenhos_recebimentos AS a WHERE empenhos_recebimentos.id_empenho = a.id_empenho))) AND empenhos.id_empenho=new.id_empenho;

  UPDATE empenhos SET cd_situacao_empenho = 'ET' WHERE ch_visualizar = 'S' AND dt_aprovacao IS NULL AND (dt_pagamento + 61 ) > CURRENT_DATE AND empenhos.id_empenho=new.id_empenho;

RETURN NEW;

END;$$;


